import React from "react";
import { Card } from "react-bootstrap";

const UserList = (props) => {
  const { user } = props;
  return;
  {
    user ? (
      <Card style={{ marginTop: "30px", textAlign: "center" }}>{user}</Card>
    ) : null;
  }
};

export default UserList;
